def select_file():
    global file_path
    file_path = askopenfilenames()
    try:
        dir_path = file_path[0].replace('/' + file_path[0].split('/')[-1], '')
    except:
        return
    t2.configure(state='normal')
    t3.configure(state='normal')
    t2.delete(1.0, 'end')
    for i in file_path:
        t2.insert('end', i + '\n')
    t3.delete(1.0, 'end')
    t3.insert('end', dir_path + '/' )
    t2.configure(state='disable')
    v5.set('Selected files' + str(len(file_path)))


def select_dir():
    t3.configure(state='normal')
    dir_path = askdirectory()
    if dir_path:
        t3.delete(1.0, 'end')
        t3.insert('end', dir_path + '/')


def clearpath():
    global file_path
    del file_path
    t2.configure(state='normal')
    t2.delete(1.0, 'end')
    t2.configure(state='disable')
    v5.set('')


def recode():
    import re
    import os
    # Find GAP
    # read files
    try:
        file_path
    except:
        showerror(title='ERROR', message='Input file not selected')
        return
    for file in file_path:
        rf = open(file)
        chy= str(t3.get(1.0,'end')[:-1])
        if chy[-1] == '/':
            chy = chy[:-1]
        out_path = chy + '/' + file.split('/')[-1].split('.')[0] + "_result"
        try:
            os.makedirs(out_path)
        except:
            t1.configure(state='normal')
            t1.insert("end", file.split('/')[-1].split('.')[0] + "_result folder has been reset\n")
            t1.see(END)
        total_file = open(out_path + '/total_gap_pos.txt', "w")
        total_detail_file = open(out_path + "/gap_seq_detail.txt", "w")
        every_file = open(out_path + "/seq_gap_information.txt", "w")
        final_file = open(out_path + "/final_only_indel.txt", "w+")
        final2_file = open(out_path + "/final_output.fasta", "w")
        total_file.write('No\tPosition\ttimes\n')
        total_detail_file.write(
            "No\tsequneces'name\n----------------------------------------------------------------------------\n")
        t1.configure(state="normal")
        t1.insert("end", "start..0%\n")
        t1.see(END)
        i = rf.readline()
        dir_total = {}
        dir_detail_total = {}
        dir_coded = {}
        dir_include = {}
        list_total = []
        dir_output = {}
        no = 1
        n_total=0
        end = 0
        while (i):
            if ('>' in i):
                seqname = i
                seqsequence = rf.readline()
                tempseq = rf.readline()
                n_total += 1
                while (tempseq):
                    if '>' not in tempseq:
                        seqsequence = seqsequence.replace('\n', '') + tempseq
                        tempseq = rf.readline()
                    else:
                        break
            # Find total_GAP
            pattern = re.compile('-+')
            match_position = pattern.finditer(seqsequence)
            if end < len(seqsequence) - 1:
                end = len(seqsequence) -1
            for temp in match_position:
                if re.findall("\d+", str(temp.span()))[0] != '0' and re.findall("\d+", str(temp.span()))[1] != str(end):
                    if temp.span() in dir_total:
                        dir_total[temp.span()] += 1
                    else:
                        dir_total[temp.span()] = 1
                # recording detail
                if str(temp.span()) in dir_detail_total:
                    dir_detail_total[str(temp.span())].append(seqname)
                else:
                    dir_detail_total[str(temp.span())] = [seqname]
            i = tempseq
        t1.insert("end", "20%\n")
        t1.see(END)
        # output total list
        if v4.get() == 'No':
            for key in list(dir_total):
                if dir_total[key] == 1 or dir_total[key] == n_total -1:
                    dir_total.pop(key)
        list_total = sorted(dir_total.items(), key=lambda d: d[0], reverse=False)  # sort dict
        pattern = re.compile('\d+')
        t1.insert("end", "30%\n")
        t1.see(END)
        for temp in list_total:
            templist = pattern.findall(str(temp))
            temp_key = re.search("([(]\d+, \d+[)])", str(temp))
            total_detail_file.write(str(no))
            for temp in dir_detail_total[temp_key.group()]:
                total_detail_file.write("\t" + str(temp))
            total_detail_file.write("----------------------------------------------------------------------------\n")
            total_file.write(
                str(no) + '\t' + str(int(templist[0]) + 1) + "-" + str(int(templist[1])) + "\t" + str(templist[2]))
            if (templist[2] == '1' or templist[2] == str(n_total - 1)):
                total_file.write(" *\n")
            else:
                total_file.write("\n")
            no += 1
        t1.insert("end", "50%\n")
        t1.see(END)
        # Coding the GAP
        no = 1
        for temp in list_total:
            dir_key = re.search("([(]\d+, \d+[)])", str(temp))
            dir_coded[dir_key.group()] = no
            # create including dir
            start_end = re.findall("\d+", str(temp))
            no2 = 1
            for temp2 in list_total:
                start_end2 = re.findall("\d+", str(temp2))
                if int(start_end[0]) <= int(start_end2[0]) and int(start_end[1]) >= int(start_end2[1]):
                    if no != no2:
                        if no in dir_include:
                            dir_include[no].append(no2)
                        else:
                            dir_include[no] = [no2]
                no2 += 1

            no += 1
        t1.insert("end", "70%\n")
        t1.see(END)
        # final output
        list_final = list(v2.get() * (no - 1))
        # find GAP in everysequence
        rf.seek(0)
        i = rf.readline()
        while (i):
            if ('>' in i):
                seqname = i
                every_file.write(i)
                final_file.write(i)
                seqsequence = rf.readline()
                tempseq = rf.readline()
                while (tempseq):
                    if '>' not in tempseq:
                        seqsequence = seqsequence.replace('\n', '') + tempseq
                        tempseq = rf.readline()
                    else:
                        break
            dir_output[seqname] = seqsequence
            pattern = re.compile('-+')
            match_position = pattern.finditer(seqsequence)
            templist = list_final
            for temp in match_position:
                if str(temp.span()) in dir_coded:
                    every_file.write(str(dir_coded[str(temp.span())]) + ' ')
                    templist[dir_coded[str(temp.span())] - 1] = v1.get()
                    if dir_coded[str(temp.span())] in dir_include:
                        for num in dir_include[dir_coded[str(temp.span())]]:
                            templist[num - 1] = v3.get()
            for i in templist:
                final_file.write(i)
            final_file.write("\n")
            every_file.write("\n")
            i = tempseq
        t1.insert("end", "90%\n")
        t1.see(END)
        # output final file
        final_file.seek(0)
        for i in final_file:
            if '>' in i:
                name = i
            else:
                final2_file.write(name + dir_output[name][:-1] + i)
        t1.insert("end", "success..100%\n")
        t1.see(END)
        t1.configure(state='disable')
    showinfo(title="Success", message='Finished')
    rf.close()
    total_file.close()
    every_file.close()
    total_detail_file.close()
    final_file.close()
    final2_file.close()

